import React from "react";
import "./MyMessage.css";

class Message extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoading: false,
    };
  }

  render() {
    return (
      <div class="mine messages">
        <div class="message">Great thanks!</div>
        <div class="message last">How about you?</div>
      </div>
    );
  }
}

export default Message;
